INSERT INTO `markdown` (`id`, `contentMarkdown`, `contentHTML`, `specialityId`, `clinicId`, `doctorId`, `image`, `introduction`, `description`, `createdAt`, `updatedAt`) VALUES
(1, '\n## Bác sĩ Chuyên khoa II Vũ Thái Hà\n\n* Hơn 10 năm kinh nghiệm lĩnh vực Tai mũi họng\n* Từng công tác tại Bệnh viện Thống Nhất, Bệnh viện Tai mũi họng TP. HCM\n* Bác sĩ nhận khám mọi độ tuổi\n\n## Khám và điều trị\n\n* Viêm tai giữa: Đau tai, chảy dịch, nghe kém, ù tai\n* Viêm mũi xoang: Đau đầu, ngạt mũi, chảy mủ\n* Viêm mũi dị ứng: Hắt xì, chảy mũi, ngứa mũi, ngạt mũi\n* Viêm họng: Đau rát họng, hôi miệng, vướng họng\n* Viêm Amidan: Sốt, đau họng, ngủ ngáy\n* Hội chứng trào ngược dạ dày thực quản: Vướng họng, thay đổi giọng nói\n* Viêm mũi VA: Ngạt mũi, ngủ ngáy\n* Viêm thanh quản: Khàn tiếng\n* Hạt xơ thanh quản: Khàn tiếng, hụt hơi\n* Dị vật đường thở: Khó thở\n* Viêm đường phế quản: Ho, tức ngực, khó thở\n* Hen phế quản: Ho, khó thở\n* Viêm phổi: Sốt, ho, khó thở\n* Nấm ống tai: Ngứa tai, ù tai\n\n## Quá trình công tác\n\n* Học Chuyên khoa II tại bệnh viện Tai mũi họng và khoa Tai mũi họng của Bệnh viện Nhân dân Gia Định, Bệnh viện Trưng Vương, Bệnh viện Thống Nhất, Bệnh viện Nhân dân 115, Bệnh viện Nhi đồng 1 (2019 - 2022)\n* Bác sĩ điều trị, khoa Tai mũi họng, Bệnh viện Thống Nhất (2016 - 2022)\n* Học Cao học tại Bệnh viện Tai mũi họng và khoa Tai mũi họng của Bệnh viện Nhân dân Gia Định, Bệnh viện Trưng Vương, Bệnh viện Thống Nhất, Bệnh viện Nhân dân 115, Bệnh viện Nhi đồng 1 (2013 - 2015)\n\n\n## Quá trình đào tạo\n\n* Bác sĩ Chuyên khoa II Chuyên ngành Tai mũi họng, Đại học Y khoa Phạm Ngọc Thạch (2022)\n* Thạc sĩ - Bác sĩ Chuyên ngành Tai mũi họng, Đại học Y khoa Phạm Ngọc Thạch (2015)\n* Bác sĩ Đa khoa, Đại học Y Dược TP. HCM (2011)\n* Chứng chỉ trong và ngoài nước\n* Chứng chỉ thính học cơ bản, Đại học Y dược TP. HCM (2016)\n* Chứng chỉ Nội soi chẩn đoán và phẫu thuật nội soi cơ bản Tai mũi họng, Đại học Y dược TP. HCM (2014)\n![img](https://raw.githubusercontent.com/mt25023011/sharing-host-file/refs/heads/main/images/header-background.jpg)', '<h2>Bác sĩ Chuyên khoa II Vũ Thái Hà</h2>\n<ul>\n<li>Hơn 10 năm kinh nghiệm lĩnh vực Tai mũi họng</li>\n<li>Từng công tác tại Bệnh viện Thống Nhất, Bệnh viện Tai mũi họng TP. HCM</li>\n<li>Bác sĩ nhận khám mọi độ tuổi</li>\n</ul>\n<h2>Khám và điều trị</h2>\n<ul>\n<li>Viêm tai giữa: Đau tai, chảy dịch, nghe kém, ù tai</li>\n<li>Viêm mũi xoang: Đau đầu, ngạt mũi, chảy mủ</li>\n<li>Viêm mũi dị ứng: Hắt xì, chảy mũi, ngứa mũi, ngạt mũi</li>\n<li>Viêm họng: Đau rát họng, hôi miệng, vướng họng</li>\n<li>Viêm Amidan: Sốt, đau họng, ngủ ngáy</li>\n<li>Hội chứng trào ngược dạ dày thực quản: Vướng họng, thay đổi giọng nói</li>\n<li>Viêm mũi VA: Ngạt mũi, ngủ ngáy</li>\n<li>Viêm thanh quản: Khàn tiếng</li>\n<li>Hạt xơ thanh quản: Khàn tiếng, hụt hơi</li>\n<li>Dị vật đường thở: Khó thở</li>\n<li>Viêm đường phế quản: Ho, tức ngực, khó thở</li>\n<li>Hen phế quản: Ho, khó thở</li>\n<li>Viêm phổi: Sốt, ho, khó thở</li>\n<li>Nấm ống tai: Ngứa tai, ù tai</li>\n</ul>\n<h2>Quá trình công tác</h2>\n<ul>\n<li>Học Chuyên khoa II tại bệnh viện Tai mũi họng và khoa Tai mũi họng của Bệnh viện Nhân dân Gia Định, Bệnh viện Trưng Vương, Bệnh viện Thống Nhất, Bệnh viện Nhân dân 115, Bệnh viện Nhi đồng 1 (2019 - 2022)</li>\n<li>Bác sĩ điều trị, khoa Tai mũi họng, Bệnh viện Thống Nhất (2016 - 2022)</li>\n<li>Học Cao học tại Bệnh viện Tai mũi họng và khoa Tai mũi họng của Bệnh viện Nhân dân Gia Định, Bệnh viện Trưng Vương, Bệnh viện Thống Nhất, Bệnh viện Nhân dân 115, Bệnh viện Nhi đồng 1 (2013 - 2015)</li>\n</ul>\n<h2>Quá trình đào tạo</h2>\n<ul>\n<li>Bác sĩ Chuyên khoa II Chuyên ngành Tai mũi họng, Đại học Y khoa Phạm Ngọc Thạch (2022)</li>\n<li>Thạc sĩ - Bác sĩ Chuyên ngành Tai mũi họng, Đại học Y khoa Phạm Ngọc Thạch (2015)</li>\n<li>Bác sĩ Đa khoa, Đại học Y Dược TP. HCM (2011)</li>\n<li>Chứng chỉ trong và ngoài nước</li>\n<li>Chứng chỉ thính học cơ bản, Đại học Y dược TP. HCM (2016)</li>\n<li>Chứng chỉ Nội soi chẩn đoán và phẫu thuật nội soi cơ bản Tai mũi họng, Đại học Y dược TP. HCM (2014)\n<img src=\"https://raw.githubusercontent.com/mt25023011/sharing-host-file/refs/heads/main/images/header-background.jpg\" alt=\"img\"></li>\n</ul>\n', NULL, NULL, 7, NULL, NULL, 'Hơn 10 năm kinh nghiệm lĩnh vực Tai mũi họng\nTừng công tác tại Bệnh viện Thống Nhất\nBác sĩ nhận khám mọi độ tuổi', '2025-04-02 08:28:41', '2025-04-02 08:28:41'),
